      <div class="tab" onClick={() => selectSection("Projects")}>Projects</div>
      <div class="tab" onClick={() => selectSection("About")}>Certifications</div>
      <div class="tab" onClick={() => selectSection("About")}>Resume</div>
    </div>
  )
}
